// SPDX-License-Identifier: MIT
pragma solidity 0.8.1;

import "@openzeppelin/contracts/utils/Counters.sol";
import "./RenntrancyGuard.sol";

interface GeekNftInterface{
    function transferFrom(address _from, address _to, uint _tokenId) external;
}

contract GeekNftMarketPlace is ReentrancyGuard {
    using Counters for Counters.Counter;

    Counters.Counter private _nftsSold;
    Counters.Counter private _nftsCount;

    uint public LISTING_FEE = 0.002 ether;
    address payable private _marketOwwner;

    mapping(uint => NFT) private _idToNft;

    struct NFT {
        address nftContract;
        uint tokenId;
        uint price;
        address payable seller;
        address payable owner;
        address payable creator;
        bool listed;
    }

    event NFTListed(address nftContract, uint tokenId, address indexed seller, address indexed owner, uint price);
    event NFTSold(address nftContract, uint tokenId, address indexed seller, address indexed owner, uint price);

    constructor() {
        _marketOwwner = payable(msg.sender);
    }

    function listNFT(address _nftContract, uint _tokenId, uint _price) public payable nonReentrant{
        require(_price > 0, "Price must be at least 1 wei");
        require(msg.value == LISTING_FEE, "Not enough ether for listing fee");
    }
}

contracts/RenntrancyGuard.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.1;

contract ReentrancyGuard {
    uint256 private constant _NOT_ENTERED = 1;
    uint256 private constant _ENTERED = 2;

    uint256 private _status;

    constructor() {
        _status = _NOT_ENTERED;
    }

    modifier nonReentrant() {
        require(_status != _ENTERED, "ReentrancyGuard: reentrant call");
        _status = _ENTERED;
        _;
        _status = _NOT_ENTERED;
    }
}

